PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE data_source (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	uri VARCHAR(200), 
	md5 VARCHAR(32), 
	date DATETIME, 
	notes VARCHAR(1000), 
	PRIMARY KEY (id), 
	UNIQUE (md5)
);
CREATE TABLE taxonomy (
	id INTEGER NOT NULL, 
	ncbi_taxid INTEGER, 
	genus VARCHAR(100) NOT NULL, 
	species VARCHAR(100) NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE its1_sequence (
	id INTEGER NOT NULL, 
	md5 VARCHAR(32), 
	sequence VARCHAR(250), 
	PRIMARY KEY (id), 
	UNIQUE (md5), 
	UNIQUE (sequence)
);
CREATE TABLE synonym (
	id INTEGER NOT NULL, 
	taxonomy_id INTEGER, 
	name VARCHAR(100) NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(taxonomy_id) REFERENCES taxonomy (id), 
	UNIQUE (name)
);
CREATE TABLE its1_source (
	id INTEGER NOT NULL, 
	source_accession VARCHAR, 
	source_id INTEGER, 
	its1_id INTEGER, 
	sequence VARCHAR(1000), 
	original_taxonomy_id INTEGER, 
	current_taxonomy_id INTEGER, 
	date_modified DATETIME, 
	seq_strategy INTEGER, 
	seq_platform INTEGER, 
	curated_trust INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(source_id) REFERENCES data_source (id), 
	FOREIGN KEY(its1_id) REFERENCES its1_sequence (id), 
	FOREIGN KEY(original_taxonomy_id) REFERENCES taxonomy (id), 
	FOREIGN KEY(current_taxonomy_id) REFERENCES taxonomy (id)
);
CREATE UNIQUE INDEX taxid_genus_species ON taxonomy (ncbi_taxid, genus, species);
CREATE UNIQUE INDEX genus_species ON taxonomy (genus, species);
COMMIT;
